--- GIAO DỊCH 27 NHÀ TRỌ SỔ HỒNG RIÊNG TẠI ĐƯỜNG Nguyễn Ảnh Thủ Phường HIỆP THÀNH - Quận 12 ---



- Diện tích : 10 m x 46 m -có 423 m2 Thổ cư - 2 sổ riêng biệt - Pháp lý hoàn chỉnh ;

- Hiện trạng : 2 block nhà co 27 nhà trọ : Nước - Điện tính theo nhà nước tính riêng mỗi căn ;

- Hiện đang cho thuê thu về nét 1 tháng 70 triệu

- Hiện trạng : 1 trệt - 1 lầu : Nhà đúc kiên cố - Phù hợp cho ở kết hợp kinh doanh đa ngành nghề ;

- Đường thông 10m - Mặt sau HT.City - Đối diện cổng chính Khu công nghiệp ;

- Có thể xây dựng 6 tầng :Tổng xây dựng được 70-80 căn trọ cho thuê ;

* Giá thương lượng nhẹ cho khách thiện chí mua nhanh : 18 TỶ VNĐ

Liên hệ : 0888.104.961 Mạnh Quân (Zalo,Viber,Imess 24/7) để xem sổ và thương lượng trực tiếp chính chủ
